window.bookSummaryJSON = "<p><b>Lukas Aguilar finds himself caught in a lethal game of battle and betrayal in which losing means death as the thrilling LitRPG/gamelit series continues.</b></p> <p>Not too long ago, Lukas Aguilar believed only what he could see and feel for himself. Then an earthquake destroyed his home and cast him into a dangerous dungeon world. He fought to survive, gaining experience and levels but losing the goddess Inanna who inhabited his mind. And he wants her back.</p> <p>But Lukas has other problems to deal with at the moment. After a calamitous skirmish, he finds himself in the \"care\" of Solana, his worst frenemy. And the immense powers he now commands are threatening to tear him apart unless he levels up. And that's only the tip of the literal iceberg.</p> <p>Because Lukas's gorgeous companion, Tanya, has her own untapped and unique skill, which could unmake reality itself if unleashed. The question is whether she will ever use it. Or if someone will force her to . . .</p> <p><b>The third volume of the hit LitRPG adventure series—with almost a million views on Royal Road—now available on Audible and wherever ebooks are sold!</b></p>"; 
